using Reloaded.Hooks;
using Reloaded.Hooks.Definitions;
using Reloaded.Hooks.Definitions.Enums;
using Reloaded.Memory.Utilities;
using System;
using System.Reflection;
using System.Runtime.CompilerServices;
using System.Runtime.InteropServices;
using System.Text;
using System.Threading;

// ÁßªÈô§Â§ö‰ΩôÁöÑ Reloaded.Hooks.Definitions ÂºïÁî®Ôºà4.3 Êó†ÈúÄÔºåÈÅøÂÖçÂÜ≤Á™ÅÔºâ
class Program
{
    #region 1. ÂéüÁîüP/InvokeÂßîÊâò‰∏éAPIÂÆö‰πâÔºàÊó†‰øÆÊîπÔºåÈÄÇÈÖçWinapiÔºâ
    [UnmanagedFunctionPointer(CallingConvention.Winapi, CharSet = CharSet.Unicode)]
    public delegate int GetPKeyDataDelegate(
        string productKey,
        IntPtr formatArg,
        string skuOrChannel,
        IntPtr formatArg2,
        int flags,
        out IntPtr outDataBlob,
        out IntPtr outString1,
        out IntPtr outString2,
        out IntPtr outString3,
        int extraFlag
    );

    [UnmanagedFunctionPointer(CallingConvention.Winapi)]
    public unsafe delegate long Sub_7FFBB9DBF60CDelegate(
        IntPtr a1,
        IntPtr a2,
        IntPtr a3,
        IntPtr a4,     // volatile int*
        IntPtr lpMem   // const wchar_t**ÔºàÊ†∏ÂøÉËß£ÊûêÁõÆÊ†áÔºâ
    );

    [DllImport("kernel32.dll", CharSet = CharSet.Unicode, SetLastError = true)]
    static extern IntPtr LoadLibrary(string lpFileName);

    [DllImport("kernel32.dll", CharSet = CharSet.Ansi, SetLastError = true)]
    static extern IntPtr GetProcAddress(IntPtr hModule, string lpProcName);

    [DllImport("kernel32.dll")]
    static extern IntPtr GetProcessHeap();

    [DllImport("kernel32.dll")]
    static extern bool HeapFree(IntPtr hHeap, int flags, IntPtr mem);

    [DllImport("kernel32.dll", SetLastError = true)]
    static extern bool FreeLibrary(IntPtr hModule);
    #endregion

    #region 2. HookÊ†∏ÂøÉÈÖçÁΩÆÔºàÂü∫ÂùÄ+Âõ∫ÂÆöÂÅèÁßªÈáèÔºåÂÖ®Â±ÄHookÂÆû‰æãÔºâ

    private const int HOOK_OFFSET = 0x2F924; // ‚Üê Ê≠£Á°ÆÁöÑ mov rdi,[rbp-41] // ‰Ω†ÁöÑÂõ∫ÂÆöÂÅèÁßªÈáè0x2F60C

    //===================‰ΩøÁî®asmhook========================
    private static IAsmHook _asmHook;
    private static ReloadedHooks _hooksInstance;
    private static IntPtr _callbackPtr;
    private static IntPtr hMod = IntPtr.Zero;
    //===================‰ΩøÁî®asmhook========================

    #endregion

    static void Main()
    {
        string productKey = "VD6RP-R2NK7-HBG8F-3DJ8T-KTPKM";
        string pkeyConfigXml = AppDomain.CurrentDomain.BaseDirectory + "pkconfig_winNext.xrm-ms";
        hMod = IntPtr.Zero;
        IntPtr pkeyConfigPtr = IntPtr.Zero;
        NativeState.LastMsftPtr = Marshal.AllocHGlobal(8);
        Marshal.WriteInt64(NativeState.LastMsftPtr, 0);

        try
        {
            // Âä†ËΩΩpidgenx.dllÂπ∂Ëé∑ÂèñÂü∫ÂùÄ
            hMod = LoadLibrary("pidgenx.dll");
            if (hMod == IntPtr.Zero)
            {
                Console.WriteLine($"‚ùå Âä†ËΩΩpidgenx.dllÂ§±Ë¥•ÔºåÈîôËØØÁ†ÅÔºö0x{Marshal.GetLastWin32Error():X8}");
                return;
            }
            Console.WriteLine($"‚úÖ pidgenx.dll 64‰ΩçÂä†ËΩΩÂü∫ÂùÄÔºö0x{hMod.ToString("X16")}");

            // Âä®ÊÄÅËÆ°ÁÆóHookÂú∞ÂùÄÔºàÊ†∏ÂøÉÔºöÂü∫ÂùÄ + Âõ∫ÂÆöÂÅèÁßªÈáèÔºåÈÄÇÈÖçASLRÔºâ
            IntPtr hookAddress = IntPtr.Add(hMod, HOOK_OFFSET);
            Console.WriteLine($"‚úÖ Âä®ÊÄÅËÆ°ÁÆóHookÂÆûÈôÖÂú∞ÂùÄÔºö0x{hookAddress.ToString("X16")}ÔºàÂü∫ÂùÄ+0x{HOOK_OFFSET:X}Ôºâ");

            Console.WriteLine($"[+] LastMsftPtr(native) = 0x{NativeState.LastMsftPtr.ToInt64():X16}");

            // 3Ô∏è‚É£ ÂàõÂª∫ AsmHook
            InstallAsmHook(hookAddress.ToInt64());

            // ÂàùÂßãÂåñGetPKeyDataÂßîÊâòÔºåÊâßË°åÂéüÂßãÈÄªËæë
            IntPtr fnGetPKeyData = GetProcAddress(hMod, "GetPKeyData");
            if (fnGetPKeyData == IntPtr.Zero)
            {
                Console.WriteLine($"‚ùå Ëé∑ÂèñGetPKeyDataÂú∞ÂùÄÂ§±Ë¥•ÔºåÈîôËØØÁ†ÅÔºö0x{Marshal.GetLastWin32Error():X8}");
                return;
            }
            var getPKeyData = Marshal.GetDelegateForFunctionPointer<GetPKeyDataDelegate>(fnGetPKeyData);

            // ÂáÜÂ§áÂèÇÊï∞Âπ∂ÊâßË°åGetPKeyData
            pkeyConfigPtr = Marshal.StringToHGlobalUni(pkeyConfigXml);
            IntPtr outBlob = IntPtr.Zero, outStr1 = IntPtr.Zero, outStr2 = IntPtr.Zero, outStr3 = IntPtr.Zero;

            Console.WriteLine("\nüìå Êåâ‰ªªÊÑèÈîÆÊâßË°åGetPKeyDataÔºåHookÂ∞ÜËá™Âä®Êã¶Êà™Âπ∂Ëß£ÊûêÊï∞ÊçÆ...");
            Console.ReadKey();

            int hr = getPKeyData(
                productKey,
                pkeyConfigPtr,
                null,
                IntPtr.Zero,
                0,
                out outBlob,
                out outStr1,
                out outStr2,
                out outStr3,
                0
            );

            // ËæìÂá∫GetPKeyDataÊâßË°åÁªìÊûú
            if (hr >= 0)
            {
                Console.WriteLine("\n‚úÖ GetPKeyDataÊâßË°åÊàêÂäüÔºåÂéüÂßãËøîÂõûÁªìÊûúÔºö");
                Console.WriteLine($"outStr1ÂØÜÈí•ÊèèËø∞: {Marshal.PtrToStringUni(outStr1) ?? "Á©∫"}");
                Console.WriteLine($"outStr2ÂØÜÈí•ÈÄöÈÅì: {Marshal.PtrToStringUni(outStr2) ?? "Á©∫"}");
                Console.WriteLine($"outStr3ÂØÜÈí•Â≠êÁ±ªÂûã: {Marshal.PtrToStringUni(outStr3) ?? "Á©∫"}");
                Console.WriteLine($"outBlobIIDÂîØ‰∏ÄÊ†áËØÜ: {Marshal.PtrToStringUni(outBlob) ?? "Á©∫"}");
            }
            else
            {
                Console.WriteLine($"\n‚ùå GetPKeyDataÊâßË°åÂ§±Ë¥•ÔºåÈîôËØØÁ†ÅÔºö0x{hr:X8}");
            }
            IntPtr msftPtr = Marshal.ReadIntPtr(NativeState.LastMsftPtr);

            if (msftPtr != IntPtr.Zero)
            {
                string s = Marshal.PtrToStringUni(msftPtr);
                Console.WriteLine($"[AdtConfigKegÔºö] {s}");
            }


            // ÈáäÊîæGetPKeyDataËøîÂõûÁöÑÂ†ÜÂÜÖÂ≠ò
            IntPtr heap = GetProcessHeap();
            if (outStr1 != IntPtr.Zero) HeapFree(heap, 0, outStr1);
            if (outStr2 != IntPtr.Zero) HeapFree(heap, 0, outStr2);
            if (outStr3 != IntPtr.Zero) HeapFree(heap, 0, outStr3);
            if (outBlob != IntPtr.Zero) HeapFree(heap, 0, outBlob);
        }
        catch (Exception ex)
        {
            Console.WriteLine($"\n‚ùå Á®ãÂ∫èÂÖ®Â±ÄÂºÇÂ∏∏Ôºö{ex.Message}\n{ex.StackTrace}");
        }
        finally
        {
            // ÂÆâÂÖ®ÈáäÊîæÊâÄÊúâËµÑÊ∫êÔºåÈÅøÂÖçÊ≥ÑÊºè
            if (_asmHook != null && _asmHook.IsEnabled)
            {
                _asmHook?.Disable();
                Console.WriteLine("\n‚úÖ Reloaded.Hooks 4.3 Â∑≤ÂÆâÂÖ®ÈáäÊîæ");
            }
            Marshal.FreeHGlobal(NativeState.LastMsftPtr);
            if (pkeyConfigPtr != IntPtr.Zero) Marshal.FreeHGlobal(pkeyConfigPtr);
            if (hMod != IntPtr.Zero) FreeLibrary(hMod); // ÈáäÊîæDLLÂè•ÊüÑ
            Console.WriteLine("‚úÖ ÊâÄÊúâËµÑÊ∫êÂ∑≤ÈáäÊîæÂÆåÊØïÔºåÊåâ‰ªªÊÑèÈîÆÈÄÄÂá∫...");
            Console.ReadKey();
        }
    }
    private static void InstallAsmHook(long hookAddress)
    {
        /*
         * Ê†àÂ∏ÉÂ±ÄËØ¥ÊòéÔºö
         * - push 8 ‰∏™ÈùûÊòìÂ§±ÂØÑÂ≠òÂô® = 64 Â≠óËäÇ
         * - sub rsp, 20h         = shadow space
         *
         * ÂéüÂßã RSP = ÂΩìÂâç rsp + 20h + 8*8
         */
        var asm = new[]
        {
            "use64",

            // rdi = msft2009 wchar_t*
            $"mov rax, {NativeState.LastMsftPtr.ToInt64()}",
            "mov [rax], rdi",
        };


        _hooksInstance = new ReloadedHooks();

        _asmHook = _hooksInstance.CreateAsmHook(
            asm,
            hookAddress,
            AsmHookBehaviour.ExecuteFirst
        ).Activate();

        Console.WriteLine("[+] AsmHook ÊøÄÊ¥ªÊàêÂäü");
    }

    static class NativeState
    {
        public static IntPtr LastMsftPtr;
    }

}

alias modeclist {
  did -r srvrdialog 1
  window -h @refserv
  if ($isfile(scripts\tmp\readserv.txt)) {
    .fopen serv scripts\tmp\readserv.txt
    while (!$feof) && ($fread(serv) != $null) {
      var %1 $v1,%g $wd(%1,1,32),%2 n/a,%3 $wd(%1,2,32),%4 $remove($wd(%1,3-7,32),WEST,WET)
      if (Mode locks for* iswmcs %1) || (Bloqueios de modo para* iswmcs %1) || (Channel*has no mode locks. iswmcs %1) || (O canal*n√£o tem mode locks. iswmcs %1) { dialog -t srvrdialog $remove(%1,$chr(46)) }
      else {
        if (%g === +f) || (%g === +k) || (%g === +L) || (%g === +l) || (%g === +F) || (%g === +H) {
          %2 = %3
          %3 = $wd(%1,3,32)
          %4 = $wd(%1,4-8,32)
        }
        if (%g === -f) || (%g === -k) || (%g === -L) || (%g === -l) || (%g === -F) || (%g === -H) {
          %2 = n/a
          %3 = $wd(%1,2,32)
          %4 = $wd(%1,3-7,32)
        }
        if ($did(srvrdialog,7).text) {
          if (* $+ $did(srvrdialog,7).text $+ * iswm %1) { did -a srvrdialog 1 + 0 0 0 $wd(%1,1,32) 	+ 0 0 0 %2 	+ 0 0 0 %3 	+ 0 0 0 %4 }
        }
        else { did -a srvrdialog 1 + 0 0 0 $wd(%1,1,32) 	+ 0 0 0 %2 	+ 0 0 0 %3 	+ 0 0 0 %4 }
      }
    }
    .fclose serv
  }
  close -@ @refserv
}
